import { Component } from '@angular/core';

@Component({
  selector: 'app-start',
  templateUrl: './start.component.html',
  styleUrls: ['./start.component.css']
})
export class StartComponent {
  viewLog : boolean = false;
  viewCreate : boolean = true; 
}
<div class="caja">
    <div class="cajaIzquierda" [ngClass]="{'visualizar':viewLog, '':!viewLog}">
        <app-login></app-login>
    </div>

    <div class="cajaDerecha" [ngClass]="{'visualizar':viewCreate, '':!viewCreate}">
        <app-create></app-create>
    </div>
</div>
